import React from 'react'
import {
    BrowserRouter as Link
  } from "react-router-dom";
 function Navbar(){
    return (
        <>
            <nav className="Navbar">
               <Link to="/" className="nav-logo">Epic</Link>
            </nav>
        </>
    ) 
 }
 export default Navbar;
